import React from 'react';
import  ReactDOM from 'react-dom';
ReactDOM.render(
                <React.Fragment>
              <h1>Devloper Programing languages must be learn.</h1> 
              <p>Moder technologies are coming into a modern world <br></br>
              so we have to update day by day to new skilles with new tranding programing languages.</p>
              <ol>
              <li>PYTHON</li>
              <li>REACT</li>
              <li>DJANGO</li>
              <li>PHP</li>
              <li>CODEIGNITER</li>
              <li>NODE.JS</li>
              <li>LARAVEL</li>

              </ol>
                </React.Fragment>
                ,document.getElementById("root"));
